import React from "react";
import './AboutUs.css'

export default function AboutUs(){
    return(
    <body className="w-100 h-auto">
        <div className="">
            <h2 className="ml-5 p-2">About Us</h2>
            <p className="mx-4">My name is Arlette Bond, I have been a homeowner in the Woodlands for 19 years, I'm a mother of two teenagers, Francis, who is working in Austin and Claire, who is a student at UT in Austin. At Claire's pooch sitting, we are focused on providing services with the highest levels of customer satisfaction & we will do everything we can to meet your expectations. With a variety of offerings to choose from, we're sure you'll be happy working with us. </p>
        </div>
    </body>
    )
}
